const ll MAXN = 2501;
const ll MAXK = 7;
const ll INF = 0x3fffffff;
ll f[MAXN][MAXN][MAXK];
class BearPairs {
	public:
	int minCost(string s, vector <int> cost, int klim) {
		ll n=s.length();
		for (ll x=0;x<n;x++) {
			for (ll k=0;k<=klim;k++) {
				f[x][x][k]=0;
			}
		}
		for (ll len=1;len<=n;len++) {
			for (ll x=0;x<=n-len;x++) {
				ll y=x+len;
				for (ll k=len&0x1;k<=klim;k+=2) {
					// Tell x to go fuck itself
					ll ans = INF;
					//printf("x:%lld y:%lld k:%lld. ",x,y,k);
					if (s[x]!=s[y-1]) ans = min(ans, f[x+1][y-1][k]+cost[x]+cost[y-1]+100*(y-1-x));
					if (k>0) ans = min(ans, f[x+1][y][k-1]);
					//printf("Usek: %lld\n",ans);
					// Pair x with z
					ll sj=1;
					for (ll z=x+1;z<y;z++) {
						for (ll j=sj;j<=k;j+=2) {
							ll nval=f[x][z][j]+f[z][y][k-j];
							ans = min(ans,nval);
						}
						sj ^= 1;
					}
					//printf("ans:%lld\n",ans);
					f[x][y][k] = min(INF,ans);
				}
			}
		}
		ll final=f[0][n][klim];
		if (final >= INF) return -1;
		return final;
	}
};
